import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (         
       <div className="App">
  <div className="App-header">
      <img src={logo} className="App-logo" alt="logo" />

      <h2>Welcome to { this.props.title }</h2>

  </div>
  <p className="App-intro">
  </p>
</div>

);
}

export default App;
